        <div className="card" key={i}>
            <Card
                word={v.word}
                part_of_speech={v.part_of_speech}
                definition={v.definition}
            />
            <Button
  className={"example-button"}
  text={"Example"}
  onClick={handleExampleClick}
/>
        </div>
    ))
    }
  </div>
    );
}
